 [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] nil nil], \"1068\" [:div nil nil [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]], \"1102\" [:div nil nil [:p/markdown \"## Progress logging\\n\\nThis should be documented better soon.\"]], \"1121\" [:div [:p/code {:code \"^kind/hiccup\\n(notespace/midje-summary)\", :bg-class \"bg-light\"}] nil [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \": \" 1]]]], \"1080\" [:div nil nil [:p/markdown \"Such tags can usually be handled through dedicated kinds too.\"]], \"1111\" [:div [:p/code {:code \"(DummyType1. [:big [:big 3]])\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"1113\" [:div [:p/code {:code \"(defmethod\\n  ^{:doc\\n    \\\"Example of user extensible kind.\\nNote the ':reload true' in the :require vector:\\n[notespace.kinds :as k :reload true].\\nThis will make REPL testing your extensible kind easier!\\\"}\\n  kind/kind->behaviour ::just-code\\n  [_]\\n  {:render-src?   true\\n   :value->hiccup (constantly nil)})\", :bg-class \"bg-light\"}] nil [:p/code {:code \"#multifn[kind->behaviour 0x319f0df4]\\n\"}]], \"1095\" [:div nil nil [:p/markdown \"### Plain html\"]], \"1066\" [:div nil nil [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]], \"1059\" [:div nil nil [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]], \"1105\" [:div [:p/code {:code \"(-> [:big [:big 3]]\\n    (kind/override kind/hiccup))\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"1017\" [:div nil nil [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]], \"1108\" [:div nil nil [:p/markdown \"## Inferring note behaviors from types\\nIt is possible to infer a note's behavior from the type of its rendered, overriding the behavior prescribed by its kind. This can be done by extending the `Behaving` protocol.\"]], \"1054\" [:div nil nil [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]], \"1052\" [:div nil nil [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]], \"1084\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/math\\n \\\"(ax ^2 + bx + c = 0 )\\\"]\", :bg-class \"bg-light\"}] nil [:p/math \"(ax ^2 + bx + c = 0 )\"]], \"1119\" [:div [:p/code {:code \"(fact\\n (+ 1 2) => 3)\", :bg-class \"bg-light\"}] nil [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \"   true\"]], \"1106\" [:div [:p/code {:code \"(-> [\\\"(ax ^2 + bx + c = 0 )\\\"]\\n    (kind/override kind/math))\", :bg-class \"bg-light\"}] nil [:div [:p/math \"(ax ^2 + bx + c = 0 )\"]]], \"1114\" [:div [:p/code {:code \"(def ^{:doc \\\"When making a user extensible kind, you MUST assign the keyword\\nto a variable. Annotating with a keyword WILL NOT WORK!\\\"} just-code ::just-code)\", :bg-class \"bg-light\"}] nil nil], \"1118\" [:div [:p/code {:code \"(require '[midje.sweet :refer [fact]])\", :bg-class \"bg-light\"}] nil nil], \"1043\" [:div nil nil [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]], \"1100\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] nil [:p/code {:code \"3\\n\"}]], \"1016\" [:div nil nil nil], \"1040\" [:div nil nil [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]], \"1046\" [:div nil nil [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]], \"1083\" [:div nil nil [:p/markdown \"### math\"]], \"1027\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] [:p/code {:code \"nil\\n\"}]], \"1058\" [:div nil nil nil], \"1021\" [:div nil nil [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]], \"1019\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] nil [:p/code {:code \"21\\n\"}]], \"1092\" [:div nil nil [:p/markdown \"--------------------\"]], \"1110\" [:div [:p/code {:code \"(deftype DummyType1 [data]\\n  notespace.behavior/Behaving\\n  (->behavior [this]\\n    {:render-src? true\\n     :value->hiccup (fn [v] data)}))\", :bg-class \"bg-light\"}] nil nil], \"1091\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:a [1 2 3]\\n :b [4 5 6]}\", :bg-class \"bg-light\"}] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"1018\" [:div nil nil [:p/markdown \"## Notes\\n\\nHere is a note:\"]], \"1042\" [:div nil nil [:p/markdown \"### Atoms\"]], \"1087\" [:div nil nil [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]], \"1089\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.6247117595294924, \"z\" \\a} {\"x\" 1, \ 34\" [:div nil nil [:p/markdown \"### Listening to changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]], \"1101\" [:div nil nil [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]], \"1067\" [:div nil nil [:big [:big 3]]], \"1062\" [:div nil nil [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]], \"1090\" [:div nil nil [:p/markdown \"--------------------\"]], \"1028\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"12\\n\"}]], \"1096\" [:div [:p/code {:code \"^kind/html\\n(str \\\"<h4>h4</h4>\\\"\\n     \\\"<h5>h5</h5>\\\")\", :bg-class \"bg-light\"}] nil [:p/html \"<h4>h4</h4><h5>h5</h5>\"]], \"1085\" [:div [:p/code {:code \"^kind/math\\n[\\\"(ax ^2 + bx + c = 0 )\\\"\\n \\\"(dx ^2 + ex + f = 0 )\\\"]\", :bg-class \"bg-light\"}] nil [:div [:p/math \"(ax ^2 + bx + c = 0 )\"] [:p/math \"(dx ^2 + ex + f = 0 )\"]]], \"1074\" [:div nil nil [:p/markdown \"The `vega` kind supports both Vega and Vega-Lite visualizations.\"]], \"1023\" [:div nil nil [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(dereferenced)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]], \"1026\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] nil [:p/code {:code \"12\\n\"}]], \"1038\" [:div nil nil [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]], \"1036\" [:div nil nil [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]], \"1025\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] nil nil], \"1051\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"1031\" [:div nil nil [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Notespace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]], \"1104\" [:div nil nil [:p/markdown \"## Overriding note kinds at runtime\\nIt is possible to override a note's kind during its evaluation using the `notespace.kinds/override` functions.\"]], \"1053\" [:div [:p/code {:code \"^kind/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] nil [:p/code {:code \"((2 1 4 1 2 0)\\n (3 2 4 5 1 0)\\n (2 2 0 4 5 3)\\n (0 0 4 3 4 2)\\n (1 0 5 5 4 3)\\n (3 4 3 0 5 4))\\n\"}]], \"1022\" [:div nil nil [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]], \"1097\" [:div nil nil [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]], \"1099\" [:div nil nil [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]], \"1117\" [:div nil nil [:p/markdown \"## Midje tests\\n\\nTests of the Midje test framework are rendered as follows:\"]], \"1120\" [:div nil nil [:p/markdown \"We can ask for a tests summary:\"]], \"1032\" [:div nil nil [:p/markdown \"#### eval-and-realize-notes-from-line\\n\\nUse `notespace.api/eval-and-realize-notes-from-line` to evaluate and realize all notes starting from a certain line, and inform Notespace.\"]], \"1047\" [:div [:p/code {:code \"^kind/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] nil nil], \"1065\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"1055\" [:div nil nil [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]], \"1107\" [:div [:p/code {:code \"(-> {:description \\\"A simple bar chart with embedded data.\\\"\\n     :data        {:values [\\n                            {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n                            {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n                            {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n                            ]}\\n     :mark        :bar\\n     :encoding    {:x {:field :a :type :nominal :axis {:labelAngle 0}}\\n                   :y {:field :b :type :quantitative}}}\\n    (kind/override kind/vega))\", :bg-class \"bg-light\"}] nil [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"1037\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] [:p/code {:code \"nil\\n\"}]], \"1081\" [:div [:p/code {:code \"^kind/code\\n[\\\"(defn abcd [x] (+ x 9))\\\"\\n \\\"(defn abcd [x] (+ x 3))\\\"]\", :bg-class \"bg-light\"}] nil [:div [:p/code \"(defn abcd [x] (+ x 9))\"] [:p/code \"(defn abcd [x] (+ x 3))\"]]], \"1103\" [:div [:p/code {:code \"(comment\\n  (require '[notespace.cljfx.api :as fx]) \\n\\n  (notespace/update-config #(assoc % :evaluation-callback-fn\\n                             (fn [idx note-count note]\\n                               (let [expected-duration (or  (get-in note [:duration]) 0)]\\n                                 (println \\\"evaluate note: \\\" idx \\\"/\\\" (dec note-count)\\n                                          \\\", expected duration (s): \\\"\\n                                          (if (pos? expected-duration)\\n                                            expected-duration\\n                                            \\\"???\\\"))))))\\n\\n  (notespace/update-config #(assoc % :in-eval-count-down-fn\\n                           (fn [seconds]\\n                             (println seconds))))\\n  (reset! state/the-context\\n          (fx/swap-context @state/the-context\\n                           #(-> (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"(-0.20908010027250834\\n -0.15733792769043176\\n 0.3395387238146079\\n 0.23413734179852996\\n 0.4655271104511475\\n 0.8119857332955789\\n 1.1215420025706022\\n 1.249009145611983\\n 1.2801247614987599)\\n\"}]], \"1088\" [:div nil nil [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value which is one of the following:\\n- a map, whose values are same-length sequentials (one example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries);\\n- a sequence of maps.\\n\\nThey render that values as an [ag-Grid](https://www.ag-grid.com/) table view.\\n\\nFor example:\"]], \"1071\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] nil nil], \"1020\" [:div nil nil [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]], \"1049\" [:div nil nil [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]], \"1035\" [:div nil nil [:p/markdown \"### Delays\"]], \"1050\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] nil nil], \"1076\" [:div nil nil [:p/markdown \"### code\"]]}}");
